import Header from "../header/Header";
import styles from "./Shop.module.css";
import Body from "../body/Body";

const Shop = (props) => {

    return <React.Fragment>
        <div className={styles.container}>
            <Header/>
            <Body/>
            Shop
        </div>

    </React.Fragment>
}

export default Shop;
